import { useState } from 'react'

const TodoCreate = (props) => {
  const { onCreate } = props
  const [title, setTitle] = useState('')
  const [priority, setPriority] = useState('medium')

  const handleChange = (event) => {
    setTitle(event.target.value)
  }

  const handlePriorityChange = (event) => {
    setPriority(event.target.value)
  }

  const handleSubmit = (event) => {
    event.preventDefault()
    onCreate(title, priority)
    setTitle('') // Clear the form after submission
    setPriority('medium') // Reset priority to medium
  }

  return (
    <form onSubmit={handleSubmit}>
      <h1>Travel To-Do List</h1>
      <input type="text" onChange={handleChange} value={title} placeholder="Add task" />
      <select value={priority} onChange={handlePriorityChange} className="priority-select">
        <option value="high" className="high"/>
        <option value="medium" className="medium"/>
        <option value="low" className="low"/>
      </select>
      <button>Add Task</button>
    </form>
  )
}

export default TodoCreate
